import { useState } from "react";
import { useEffect } from "react";
import Img from "./Img";

export function CatList_Container() {

	const [catlist, setCatlist] = useState([]);
	const[selectedCatImag,setselectedCatImag] = useState();

	fetch('https://api.thecatapi.com/v1/images/search?breed_ids=abys')
	.then((res) => res.json())
	.then()

	useEffect(() => {
		fetch('https://api.thecatapi.com/v1/breeds')
		.then(function(res) {
			console.log(res.json);
			return res.json();
		})
		.then(function(json) {
			console.log(json.name)
			console.log(Object(json))
			return setCatlist(Object(json))
		})
	},[])



	return(
		<>
		<Img name={catlist} />
		</>
	)

}

export default CatList_Container;
